//	Simplex 3D Noise 
//	by Ian McEwan, Ashima Arts
//
vec4 permute(vec4 x){return mod(((x*34.0)+1.0)*x, 289.0);}
vec4 taylorInvSqrt(vec4 r){return 1.79284291400159 - 0.85373472095314 * r;}

float simplex3d(vec3 v){ 
  const vec2  C = vec2(1.0/6.0, 1.0/3.0) ;
  const vec4  D = vec4(0.0, 0.5, 1.0, 2.0);

// First corner
  vec3 i  = floor(v + dot(v, C.yyy) );
  vec3 x0 =   v - i + dot(i, C.xxx) ;

// Other corners
  vec3 g = step(x0.yzx, x0.xyz);
  vec3 l = 1.0 - g;
  vec3 i1 = min( g.xyz, l.zxy );
  vec3 i2 = max( g.xyz, l.zxy );

  //  x0 = x0 - 0. + 0.0 * C 
  vec3 x1 = x0 - i1 + 1.0 * C.xxx;
  vec3 x2 = x0 - i2 + 2.0 * C.xxx;
  vec3 x3 = x0 - 1. + 3.0 * C.xxx;

// Permutations
  i = mod(i, 289.0 ); 
  vec4 p = permute( permute( permute( 
            i.z + vec4(0.0, i1.z, i2.z, 1.0 ))
          + i.y + vec4(0.0, i1.y, i2.y, 1.0 )) 
          + i.x + vec4(0.0, i1.x, i2.x, 1.0 ));

// Gradients
// ( N*N points uniformly over a square, mapped onto an octahedron.)
  float n_ = 1.0/7.0; // N=7
  vec3  ns = n_ * D.wyz - D.xzx;

  vec4 j = p - 49.0 * floor(p * ns.z *ns.z);  //  mod(p,N*N)

  vec4 x_ = floor(j * ns.z);
  vec4 y_ = floor(j - 7.0 * x_ );    // mod(j,N)

  vec4 x = x_ *ns.x + ns.yyyy;
  vec4 y = y_ *ns.x + ns.yyyy;
  vec4 h = 1.0 - abs(x) - abs(y);

  vec4 b0 = vec4( x.xy, y.xy );
  vec4 b1 = vec4( x.zw, y.zw );

  vec4 s0 = floor(b0)*2.0 + 1.0;
  vec4 s1 = floor(b1)*2.0 + 1.0;
  vec4 sh = -step(h, vec4(0.0));

  vec4 a0 = b0.xzyw + s0.xzyw*sh.xxyy ;
  vec4 a1 = b1.xzyw + s1.xzyw*sh.zzww ;

  vec3 p0 = vec3(a0.xy,h.x);
  vec3 p1 = vec3(a0.zw,h.y);
  vec3 p2 = vec3(a1.xy,h.z);
  vec3 p3 = vec3(a1.zw,h.w);

//Normalise gradients
  vec4 norm = taylorInvSqrt(vec4(dot(p0,p0), dot(p1,p1), dot(p2, p2), dot(p3,p3)));
  p0 *= norm.x;
  p1 *= norm.y;
  p2 *= norm.z;
  p3 *= norm.w;

// Mix final noise value
  vec4 m = max(0.6 - vec4(dot(x0,x0), dot(x1,x1), dot(x2,x2), dot(x3,x3)), 0.0);
  m = m * m;
  float n = 42.0 * dot( m*m, vec4( dot(p0,x0), dot(p1,x1), 
                                dot(p2,x2), dot(p3,x3) ) );

  n = ( n + 1.0 ) / 2.0;
  return clamp( n, 0.0, 1.0 );
}

vec3 hsvToRgb(vec3 hsv) {
  vec4 K = vec4(1.0, 2.0 / 3.0, 1.0 / 3.0, 3.0);
  vec3 p = abs(fract(hsv.xxx + K.xyz) * 6.0 - K.www);
  return hsv.z * mix(K.xxx, clamp(p - K.xxx, 0.0, 1.0), hsv.y);
}


float getSimplex( 
  vec3 point, float frequency, float amplitude, float persistance, float lacunarity, int octaves, float exponent, float ridge, bool normalize
) {
  float n = 0.0;
  float f = frequency;
  float a = amplitude;
  float divider = 0.0;

  for(int i = 0; i < min(5, octaves); i++) {
    vec3 p = point * f;
    float on = pow(simplex3d(p), exponent);

    if(on > ridge) on = ridge - (on - ridge);
    on /= ridge;

    n += a * on;

    divider += a;

    a *= persistance;
    f *= lacunarity;
  }

  if(normalize && divider != 0.0) { 
    n /= divider; 
  }

  return amplitude * n;
}

vec3 getPolarDisplace( 
  vec3 point, float angle1, float angle2, float radius
) {
  float dx = radius * cos(angle1) * sin(angle2);
  float dy = radius * sin(angle1) * cos(angle2);
  float dz = radius * cos(angle2);
  return point + vec3(dx, dy, dz);
}

vec3 getFeedback( 
  vec3 point, float scale, sampler2D tFeedback
) {
  return texture2D(tFeedback, point.xy / (viewport * scale)).rgb;
}

vec3 getImage( 
  vec3 point, sampler2D source, float scaleX, float scaleY, float translateX, float translateY
) {
  vec2 samplePoint = (point.xy + vec2(translateX, translateY)) * vec2(scaleX, scaleY);
  return texture2D(source, samplePoint).rgb;
}

vec3 getColorCombine( 
  vec3 value1, vec3 value2, int operation
) {
  if(operation == 0) {
    return value1 + value2;
  } else if(operation == 1) {
    return value1 * value2;
  } else if(operation == 2) {
    return pow(value1, value2);
  } else if(operation == 3) {
    return (value1 + value2) / 2.0;
  } else if(operation == 4) {
    return mod(value1, value2);
  } else if(operation == 5) {
    return hsvToRgb(value1).z > hsvToRgb(value2).z ? value1 : value2;
  } else {
    return hsvToRgb(value1).z < hsvToRgb(value2).z ? value1 : value2;
  }
}

vec3 getLerp( 
  vec3 value1, vec3 value2, float amount
) {
  return mix(value1, value2, amount);
}

vec3 getContrast( 
  vec3 source, float contrast, float brightness
) {
  return (source - 0.5) * contrast + 0.5 + brightness;
}

vec3 getRoot( 
  vec3 point, vec3 color, float dithering, vec2 ditheringTextureDimensions, sampler2D tDithering
) {
  vec2 ditheringCoord = gl_FragCoord.xy / ditheringTextureDimensions + vec2(fract(time * 13.41), fract(time * 3.451));
  vec3 ditheringValue = dithering * texture(tDithering, ditheringCoord).rgb - dithering / 2.0;
  return color + ditheringValue;
}

void main() {
  vec3 point = vec3(gl_FragCoord.xy * uScale_647, 0.0);
  float scale = uScale_647;
  vec3 pointOffset = vec3(uSpeedX_647, uSpeedY_647, uSpeedZ_647) * time;
  point += pointOffset;
  float rSimplex_655 = getSimplex(point, uFrequency_655, uAmplitude_655, uPersistance_655, uLacunarity_655, uOctaves_655, uExponent_655, uRidge_655, uNormalize_655);
  vec3 rPolarDisplace_656 = getPolarDisplace(point, uAngle1_656, rSimplex_655, uRadius_656);
  vec3 rFeedback_657 = getFeedback(rPolarDisplace_656, scale, uTFeedback_657);
  vec3 rPolarDisplace_695 = getPolarDisplace(rPolarDisplace_656, uAngle1_695, uAngle2_695, uRadius_695);
  vec3 rImage_778 = getImage(rPolarDisplace_695, uSource_778, uScaleX_778, uScaleY_778, uTranslateX_778, uTranslateY_778);
  vec3 rColorCombine_780 = getColorCombine(uValue1_780, rImage_778, uOperation_780);
  vec3 rLerp_659 = getLerp(rFeedback_657, rColorCombine_780, uAmount_659);
  vec3 rContrast_660 = getContrast(rLerp_659, uContrast_660, uBrightness_660);
  vec3 rRoot_647 = getRoot(point, rContrast_660, uDithering_647, uDitheringTextureDimensions_647, uTDithering_647);
  vec4 result = vec4(rRoot_647, 1.0);
  gl_FragColor = result;
}
